import React, { Component } from 'react';

export default class DropDown extends Component{
	constructor(props) {
        super(props)       
		this.state = {
			options : [
				{
					id:"1",
					option:"Option 1"
				},
				{
					id:"2",
					option:"Option 2"
				}
			]
		}
    }

	render(){
		var options = this.state.options;

		var showOptions;
		showOptions = options.map((data,index) => {
			return(
		 			<option value={data.option} key={index}>{data.option}</option>
				);
		})

		onInputSelect = (e) => {
			console.log(e.target.value);
		} 

		return(
			<div className="container">
				<div className="row">
					<div className="col-sm-4">
					<form>
						<select name="cars" className="custom-select mb-3" onChange = {e => onInputSelect(e.target.value)}>
					      	{showOptions}
					    </select>
					</form>
					</div>
				</div>
			</div>
		);
	}
}
